import { useQuery } from '@tanstack/react-query';
import React, { useContext } from 'react';

const MyBuyers = () => {
    const {user} = useContext(Auth)
    const { data: orders = [], refetch } = useQuery({
        queryKey: ['orders'],
        queryFn: async () => {
            const res = await fetch()
        }
    })
    return (
        <div>
            My Buyers
        </div>
    );
};

export default MyBuyers;
